import React, { useState} from 'react';


function Counter () {
    const [Count, setCount] = useState("1");


    function ChangeCount(e){
    setCount(e.target.value);
    }
    return(
        <div>
        <h2>{Count}</h2>
            <button 
            onClick={ChangeCount}>Add
            <button>+</button>
            <button>-</button>
            </button>
        </div>
    )

}
export default Counter;
